    species_name VARCHAR(50) NOT NULL,
    genome_size INT
);

CREATE TABLE Genes (
    gene_id INT PRIMARY KEY,
    gene_name VARCHAR(50) NOT NULL,
    chromosome VARCHAR(10),
    species_id INT REFERENCES Species(species_id)
);

CREATE TABLE Mutations (
    mutation_id INT PRIMARY KEY,
    gene_id INT REFERENCES Genes(gene_id),
    mutation_type VARCHAR(20),
    mutation_position INT
);

CREATE TABLE Alignments (
    alignment_id INT PRIMARY KEY,
    alignment_score FLOAT,
    mutation_id INT REFERENCES Mutations(mutation_id)
);

CREATE TABLE Sequences (
    sequence_id INT PRIMARY KEY,
    sequence_data TEXT,
    alignment_id INT REFERENCES Alignments(alignment_id)
);

